    case 74: /* param_size */
{
 
}
      break;
    case 41: /* expr */
    case 44: /* affix */
    case 45: /* suffix */
    case 46: /* contains */
    case 47: /* verbatim */
    case 48: /* termlist */
    case 49: /* union */
    case 50: /* text_union */
    case 51: /* text_expr */
    case 52: /* fuzzy */
    case 53: /* tag_list */
    case 55: /* geometry_query */
    case 56: /* vector_query */
    case 57: /* vector_command */
    case 58: /* vector_range_command */
{
 QueryNode_Free((yypminor->yy47)); 
}
      break;
    case 42: /* attribute */
{
 rm_free((char*)(yypminor->yy55).value); 
}
      break;
    case 43: /* attribute_list */
{
 array_free_ex((yypminor->yy63), rm_free((char*)((QueryAttribute*)ptr )->value)); 
}
      break;
    case 54: /* geo_filter */
{
 QueryParam_Free((yypminor->yy56)); 
}
